import React, { useEffect, useState } from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import { useParams } from 'react-router-dom';
import { fetchCourse } from '../http/courseAPI';

const CoursePage = () => {
    const [course, setCourse] = useState({ module: [] })
    const { course_id } = useParams()
    console.log(course_id)
    useEffect(() => {
        fetchCourse(course_id).then(data => setCourse(data))
    }, [])
    return (
        <Container>
            <Row>
                <Col md={2}>type</Col>
            </Row>
            <Row>
                <Col md={12}>{course.course_name}</Col>
            </Row>
            <Row>
                <Col md={2}>btn</Col>
                <Col md={2}>close date</Col>
            </Row>
            <Row>
                <Col md={3}>format</Col>
                <Col md={3}>{course.course_price} рублей</Col>
                <Col md={3}>{course.course_duration} часов</Col>
                <Col md={3}>shedule</Col>
            </Row>
            <Row>
                <h2>План программы</h2>
                {course.module.map(module =>
                    <Row key={module.module_id}>
                        {module.module_name}
                    </Row>
                )}
            </Row>
        </Container>
    );
};

export default CoursePage;
